function MoviesTable () {
    return (
        <div className="table">
            <table>
                <tr>
                    <th>Titulo</th>
                    <th>Duracion</th>
                    <th>Rating</th>
                    <th>Genero</th>
                    <th>Premios</th>
                </tr>
            </table>
        </div>
    )
}

export default MoviesTable;
